import React from 'react';
import './selectWorkout.scss'
import FormControl from '@material-ui/core/FormControl';
import InputLabel from '@material-ui/core/InputLabel';
import Select from '@material-ui/core/Select';
import TextField from '@material-ui/core/TextField';

const currencies = [
    {
        value: 'USD',
        label: '$',
    },
    {
        value: 'EUR',
        label: '€',
    },
    {
        value: 'BTC',
        label: '฿',
    },
    {
        value: 'JPY',
        label: '¥',
    },
];



function SelectWorkout(props) {
    console.log(props.exercise)

    // const handleChange = (event) => {
    //     const workoutName = event.target.name;
    //     this.setState({
    //       [workoutName]: event.target.value,
    //     });
    //   };

    return (
        <div className="selectWorkout">
            <FormControl variant="filled" className="selectWorkout__select">
                {/* <InputLabel>tets</InputLabel> */}
                <TextField
                    id="filled-select-currency-native"
                    select
                    label="Select Workout"
                    // value={currency}
                    // onChange={handleChange}
                    // SelectProps={{
                    //     native: true,
                    // }}
                    variant="filled">

                    {currencies.map((option) => (
                        <option key={option.value} value={option.value}>
                            {option.label}
                        </option>
                    ))}
                </TextField>
            </FormControl>
            {/* <div className="selectWorkout__category">
                <h2>Exercise</h2>
                <h2>Muscle</h2>
                <h2>Reps/Time</h2>
                <h2>Weight</h2>
            </div> */}


            {props.exercises.map((exercise) => {
                return (
                    <div className="selectWorkout__item">
                        <div className="selectWorkout__item-top">>
                            <TextField
                                className="selectWorkout__item-single"
                                id="filled-basic"
                                label="Exercise"
                                variant="filled"
                                defaultValue={exercise.exerciseName}
                            />
                            <TextField
                                className="selectWorkout__item-single"
                                id="filled-basic"
                                label="Muscle"
                                variant="filled"
                                defaultValue={exercise.muscle}
                            />
                        </div>
                        <div>
                            <TextField
                                className="selectWorkout__item-single"
                                id="filled-basic"
                                label="Reps/Time"
                                variant="filled"
                                defaultValue={exercise.repsTime}
                            />
                            <TextField
                                className="selectWorkout__item-single"
                                id="filled-basic"
                                label="Weight"
                                variant="filled"
                                defaultValue={exercise.weight}
                            />
                        </div>

                    </div>
                )
            })
            };



        </div>
    );
}

export default SelectWorkout;
